    <>
      <Carousel style={{height: '500px', overflow: 'hidden', marginBottom:'3rem'}}   fade >

        <Carousel.Item interval={2000}>
          <Image
                
                fluid
                src={slider1}
                alt="me"
                
                
            />
          
        </Carousel.Item>

        <Carousel.Item interval={2000}>
          <Image
                
                fluid
                src={slider2}
                alt="me"
                
                
            />
          
        </Carousel.Item>

        <Carousel.Item interval={4000}>
          <Image
                
                fluid
                src={slider3}
                alt="me"
                
                
            />
          
        </Carousel.Item>

      </Carousel>
      <h2 style={{textAlign:'center'}}>Our Services  </h2>
      <Cards />
    </>   
  );
}
export default function HomeComponent() {
  return (
    <>
      <Home />
    </>
  );
}
